import React from 'react'
import './skills.css'
import { Link } from 'react-scroll';


const Skills = () => {
    return (
        <section id="skills">
            <div className= "skillsContent"># Skills<span className="dash"></span>
           
            </div>
        </section>
    )
}
export default Skills

const Intro = () => {
    return (
        <section id="intro">
            <div className="introContent">
                <span className="about"># About Me<span className="dash"> </span></span>
                <p className="introPara">I am a sophomore Computer Science student currently working towards a minor in DAS and a certificate in GIS.</p>
            </div>
            <div className="img">
                <img src={me} alt="net" className="img" />
            </div>
        </section>
    )
}
